import { initializeApp } from "firebase/app";
import { signOut, getAuth } from "firebase/auth";
import { Link, useNavigate } from "react-router-dom";

import {useEffect,useState } from "react";
import "./das.css";
import axios from "axios";

function App() {
  const [data, setData] = useState([]);
  const [value, setValue] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    fetch("http://localhost:3006/learn")
      .then((jos) => {
        return jos.json();
      })
      .then((das) => {
        setData(das);
      });
  }, []);

  const Search = async (event) => {
    event.preventDefault();
    return await axios.get(`http://localhost:3006/learn?q=${value}`)
      .then((res) => {
        setData(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  const firebaseConfig = {
    apiKey: "AIzaSyC7MwQj8ZGicF-U1aM3I_1nfhHuA_Q5HCw",
    authDomain: "john-e2518.firebaseapp.com",
    projectId: "john-e2518",
    storageBucket: "john-e2518.appspot.com",
    messagingSenderId: "1078894862798",
    appId: "1:1078894862798:web:29e5244dbedd43b5a34b9f",
    measurementId: "G-BGRPBEH5BY",
  };

  const app = initializeApp(firebaseConfig);
  const auth = getAuth();

  const SubmitOn = (event) => {
    event.preventDefault();

    signOut(auth)
      .then(() => {
        alert("Your account has been successfully created..");
        navigate("/login.pro");
      })
      .catch((err) => {
        alert("Error", err);
      });
  };


  

  return (
    <div class="container text-center">
    <div class="row row-cols-auto">
      <div class="col">
      <div class="col">
      <div class="col">
      <div class="col">
    
    <div style={{ width: "100%" }}>
      <div>
        <div className="card-body">
          <div className="two">
            <ul style={{ listStyle: "none" }}>
              <img
                src="https://1000logos.net/wp-content/uploads/2017/05/Color-Rolex-Logo.jpg"
                style={{ width: "100px", height: "70px" }}/>
              
                <li>
                   <form onSubmit={Search}>
                  <input value={value}  onChange={(e) => setValue(e.target.value)}  type="text"  placeholder="Search for Product" style={{width:"500px",borderRadius:"30px",height:"40px",marginLeft:"20px",marginTop:"20px"}} />
                   </form>
                </li>
               
              <li
                style={{
                  fontSize: "25px",
                  borderRadius: "50%",
                  marginLeft: "100px",
                  border: "2px solid green",
                  width: "40px",
                  height: "40px",
                  marginTop: "20px",
                  textAlign: "center",
                }}>
                <i class="fa-solid fa-bell"></i>
              </li>

              <form onSubmit={SubmitOn}>
                <Link to="/login.pro">
                  <a
                    className="btn btn-danger"
                    style={{ marginLeft: "320px", marginTop: "20px" }}>
                    Logout
                  </a>
                </Link>
              </form>
            </ul>
          </div>
          <div className="container">
          
    

            <div className="one">
            {data.map((one) => (
                <ul style={{ listStyle: "none" }}>
                  <div id="b">
                    <img src={one.img}style={{width: "200px", height: "200px", marginLeft: "8px" }} ></img>
                    <li> <span style={{ fontSize: "18px", marginLeft: "35px" }}>  Brand : </span> {one.brand} </li>
                    <li style={{ marginLeft: "35px" }}>{one.collection}</li>
                    <li> <span style={{ fontSize: "18px", marginLeft: "35px" }}> Model : </span> {one.model} </li>
                    <li style={{ marginLeft: "35px" }}>{one.reference}</li>
                    <li style={{ marginLeft: "35px" }}>{one.complement}</li>
                    <li> <span style={{ fontSize: "18px", marginLeft: "35px" }}> Year : </span>{one.year}</li>
                    <li> <span style={{ fontSize: "18px", marginLeft: "35px" }}> Price :</span>{one.price}<a style={{ color: "blue", fontSize: "20px" }}>$</a></li>
                    <button id="a" className="btn btn-success">  Add Cart </button>
                  </div>
                </ul>
              ))}
              </div>
             
          </div>
          </div>
        </div>
      </div>
      </div>
              </div>
            </div>
            </div>
            </div>
          </div>
  )
}

export default App;
